using System;using System.Collections.Generic;using System.ComponentModel.DataAnnotations;using System.ComponentModel.DataAnnotations.Schema;namespace Asga.Auth{    [Table("TenantApps", Schema = "Auth")]    public partial class TenantApp : Asga.AuthModelBase, Asga.IAuthModel    {        public TenantApp()        {            Roles = new HashSet<Role>();            TenantAppUsers = new HashSet<TenantAppUser>();        }        public long Id { get; set; }        [StringLength(150)]        public string Name { get; set; }        [StringLength(150)]        public string DisplayName { get; set; }        [Column(TypeName = "datetime")]        public DateTime? CreatedOn { get; set; }        public long? CreatedBy { get; set; }        [Column(TypeName = "datetime")]        public DateTime? UpdatedOn { get; set; }        public long? UpdatedBy { get; set; }        [InverseProperty("TenantApp")]        public ICollection<Role> Roles { get; set; }        [InverseProperty("TenantApp")]        public ICollection<TenantAppUser> TenantAppUsers { get; set; }    }}